package com.shenjinxiang.tcp;


import java.util.ArrayList;
import java.util.List;

public class Demo {

    public static void main(String[] args) {
//        String str = "" +
//                "" +
//                "" +
//                "";
        String str = "";
//        String str = "";
//        String str = "";
        List<Wave> waves = parase(str);
        System.out.println(JsonKit.toJson(waves));

    }

    private static List<Wave> parase(String str) {
        int len = str.length() / 4;
        String[] strs = new String[] {
                str.substring(0, len),
                str.substring(len, 2 * len),
                str.substring(2 * len, 3 * len),
                str.substring(3 * len, 4 * len)
        };
        List<Wave> waves = new ArrayList<>();

        for(String s: strs) {
            byte[] bytes = ByteKit.hexStrToByteArray(s);
            Wave wave = new Wave();
            int p = ByteArrayConveter.getInt(bytes, 0);
            wave.setPickpoint(p);
            int index = 4;
            List<Float> floats = new ArrayList<>();
            while (index < bytes.length) {
                float f = ByteArrayConveter.getFloat(bytes, index);
                floats.add(f);
                index+=4;
            }
            wave.setData(floats);
            waves.add(wave);
        }
        return waves;
    }
}
